import React from 'react';
import styled from "styled-components";


type SectionTitlePropsType = {
    position?: string
    zIndex?: number
    left?: string
    right?: string
    top?: string
    bottom?: string
}



export const SectionTitle = styled.h2<SectionTitlePropsType>`
  text-align: center;
  font-weight: 400;
  font-size: 48px;
  position: ${props => props.position};
  z-index: ${props => props.position};
  position: ${props => props.position};
  position: ${props => props.position};
  position: ${props => props.position};
  position: ${props => props.position};
  
`
